import StyleChange from '../../Functions/ChangeStyles';
import * as actions from '../../Redux/Actions/actions';

export const recordsPerPage = (
  <div>
    <p style={{ color: 'wheat' }}>Orders per page </p>
    <button
      className="recordsPerPage"
      id="12" //======================================!!!!!!!!!!!!!!!!!!!!!!
      onClick={(e) => {
        this.props.getOrders(e.target.id, this.props.pageNumber);
        StyleChange(e.target.id, 'recordsPerPage');
      }}
    >
      12
    </button>
    <button
      className="recordsPerPage"
      id="24"
      onClick={(e) => {
        this.props.getOrders(e.target.id, this.props.pageNumber);
        StyleChange(e.target.id, 'recordsPerPage');
      }}
    >
      24
    </button>
    <button
      className="recordsPerPage"
      id="48"
      onClick={(e) => {
        this.props.getOrders(e.target.id, this.props.pageNumber);
        StyleChange(e.target.id, 'recordsPerPage');
      }}
    >
      48
    </button>
  </div>
);

function mapDispatchToProps(dispatch) {
  return {
    getOrders: (rowsPerPage, pageNumber) =>
      dispatch(
        actions.FeetchMainTableData('ordersPage', rowsPerPage, pageNumber),
      ),
    setUpdateModalState: () => dispatch(actions.SetUpdateModalState()),
    setCreateModalState: () => dispatch(actions.SetCreateModalState()),
    setActiveId: (id) => dispatch(actions.SetActiveIdentifier(id)),
    getOrder: (id, activeMenu) =>
      dispatch(actions.FetchActiveRecordData(id, activeMenu)),
    getSchedule: (employeeId, dateOfService, procedureId, open, close) =>
      dispatch(
        actions.GetAvaliableTimes(
          employeeId,
          dateOfService,
          procedureId,
          open,
          close,
        ),
      ),
  };
}

export default connect(mapStateToProps, mapDispatchToProps)(OrdersList);
